CREATE TABLE enrolled_feaa (
	student_id NUMBER(10) PRIMARY KEY,
	family_name VARCHAR2(70),
	father_name_initial VARCHAR2(10 CHAR),
	first_name VARCHAR2(70),
	birth_date DATE,
	enrollment_year NUMBER(5,0),
	admission_grades_avg NUMBER(10,2)
	) ; 


